import React from "react";
import SearchBar from "./SearchBar";
import { Link, NavLink } from "react-router-dom";

const Nav = ({ onSearch }) => {
  return (
    <div>
      <SearchBar onSearch={onSearch} />
      <button>
        <NavLink to="/about">About</NavLink>
      </button>
      <button>
        <NavLink to="/home">Home</NavLink>
      </button>
    </div>
  );
};

export default Nav;
